import bpy

############################ Add Actions ############################ 

def add_armature_actions(self, context):
    
    self.blenrig_action_names[:] = []   
    
    action_name = [] 
    fcurve_data_path = []
    fcurve_index = []

    def add_actions(a_name, a_use_fake_user):
        action_name[:] = [] 
        action = bpy.data.actions.new(a_name)
        action.id_root = 'OBJECT'    
        action.use_fake_user = a_use_fake_user
        action_name.append(action.name)
        self.blenrig_action_names.append(action.name)

    def add_fcurves(fc_data_path, fc_index, fc_group, fc_extrapolation, fc_color):
        fcurve_index[:] = []
        fcurve_data_path[:] = []    
        for A in bpy.data.actions:
            if A.name == action_name[0]:            
                fcurve = A.fcurves.new(fc_data_path, fc_index, fc_group)   
                fcurve.extrapolation = fc_extrapolation
                fcurve.color[:] = fc_color
                fcurve_data_path.append(fcurve.data_path)            
                fcurve_index.append(fcurve.array_index)
        
    def add_keys(k_frame, k_value, k_easing, k_handle_left_type, k_handle_right_type, k_interpolation, k_handle_left_frame, k_handle_left_value, k_handle_right_frame, k_handle_right_value ):
        for A in bpy.data.actions:
            if A.name == action_name[0]: 
                for FC in A.fcurves:
                    if FC.data_path == fcurve_data_path[0]:
                        if FC.array_index == fcurve_index[0]:
                            key = FC.keyframe_points.insert(k_frame, k_value)
                            key.easing = k_easing
                            key.handle_left_type = k_handle_left_type   
                            key.handle_right_type = k_handle_right_type
                            key.interpolation = k_interpolation
                            key.handle_left[0] = k_handle_left_frame
                            key.handle_left[1] = k_handle_left_value                    
                            key.handle_right[0] = k_handle_right_frame
                            key.handle_right[1] = k_handle_right_value                    

    # Add actions

